  false,\n\t\"url\": null,\n\t\"notes\": \"Metadata describing geological samples
  curated by Earth Sciences Department of the University of Southern California (USC)
  collected during the periodn               from 1922 to 1981 were coded and contributed
  by USC to the Index to Marine and Lacustrine Geological Samples (IMLGS) database.
  Descriptions are for 7,472 n               cores, grabs, and dredges, most collected
  in the eastern Pacific Ocean, offshore California, during 390 cruises of the Velero
  IV, 1 cruise of the n               Thomas G. Thompson, and 1 cruise of the Agassiz.
  Please contact the USC Department of Earth Sciences for the current status of the
  USC collection.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
